import React from "react";
import styled from "styled-components";
import K from "../assets/title/K.png";

const StyledHeader = styled.div`
  .accueil {
    position: absolute;
    left: 75.08%;
    right: 13.95%;
    /* top: 25%; */
    bottom: 25%;

    font-family: "Montserrat";
    font-style: normal;
    font-weight: 500;
    font-size: 24px;
    line-height: 142.6%;
    /* or 34px */

    display: flex;
    align-items: flex-end;
    text-align: right;
    text-decoration-line: underline;

    color: #ff6060;
  }
  .propos {
    position: absolute;
    left: 90.65%;
    right: 0%;
    top: 25%;
    bottom: 25%;

    font-family: "Montserrat";
    font-style: normal;
    font-weight: 500;
    font-size: 24px;
    line-height: 142.6%;
    /* or 34px */

    display: flex;
    align-items: flex-end;
    text-align: right;

    color: #ff6060;
  }
`;

export default function Header() {
  return (
    <StyledHeader>
      <p className="accueil">Accueil</p>
      <p className="propos">Ã€ Propos</p>
    </StyledHeader>
  );
}
